insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES,issuenum) values('12706','MDA-41','10074','xsintive','fdaugan','2','Gestion des vues dans la doc technique','Lors de la transformation du modèle en document Word, serait-il possible de  : \n\nCréer une section Vues dans le document Word.\n\nCette section regroupera tous les objets possédant, entre autres, le stéréotype \"view\" défini dans le PIM. Ces objets ne devront plus être présent dans la section regroupant les \"do\" (alors qu ils peuvent en posséder le stéréotype).\nCes objets \"view\" auront des liens d utilisations (\"use\") vers d autres objets du modèle (éventuellement stéréotypés \"view\") afin de préciser sur quels objets repose leur construction. \nIl se peut que les objets référencés n aient pas de stéréotypes.\n\nL ajout de stéréotype \"view\" ne changera en rien la génération Java du modèle.\n\n',NULL,'4',NULL,'1','2009-07-09 08:45:33','2009-12-09 20:26:49',NULL,'0',NULL,NULL,NULL,'20258',NULL,NULL,NULL,NULL,'0',41);
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('15114','MDA-207','10074','fdaugan','fdaugan','2','Outil de complétion des diagrammes de séquence par des référence de diagramme','Afin de faciliter la navigation dans les diagrammes de séquence, compléter sur demande les diagrammes de séquence existant par des références.\nAinsi par un double clic, il sera possible d accéder directement au diagramme de séquence de l opération appelé, et ainsi pouvoir passer en revue toute la chaîne d appel.',NULL,'4',NULL,'1','2009-12-10 16:40:23','2009-12-18 17:03:24',NULL,'0',NULL,NULL,NULL,'20282',NULL,NULL,NULL,NULL,'0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('11432','MDA-1','10074','fdaugan','fdaugan','1','Mise à disposition d un update site pour RSM 7.0.0.4','Demande de mise à disposition d un update site disponible depuis Help -> Updates -> Install new Feature',NULL,'3','1','6','2009-03-23 15:26:43','2011-09-22 09:25:47','2009-03-24 00:00:00','0','10951','11951','12951','18951','10020',NULL,NULL,'2011-08-04 22:37:06','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('11437','MDA-4','10074','xsintive','fdaugan','1','Génération hbm.xml : type des clés composite n-x','En fait la version actuelle est la 3.1.13\n\nDans Jour.hbm\n\n<set name=\"periodeScolaire\" table=\"RF_PERIODESCOLAIRE_JOUR_JOUR\">\n\n                  <key>\n\n                        <column name=\"JOUR_DATE_CALENDRIER\"/>\n\n                  </key>\n\n                  <many-to-many class=\"fr.stime.model.PeriodeScolaire\">\n\n                        <column name=\"PERIODESCOLAIRE\" sql-type=\"integer\" />\n\n                  </many-to-many>\n\n            </set>\n\n            <set name=\"coefficientsCorrecteurs\" table=\"RF_COEFFICIENTSCORRECTEURS_FE1\">\n\n                  <key>\n\n                        <column name=\"JOUR_DATE_CALENDRIER\"/>\n\n                  </key>\n\n                  <many-to-many class=\"fr.stime.model.CoefficientCorrecteur\">\n\n                        <column name=\"COEFFICIENTSCORRECTEURS\" sql-type=\"integer\" />\n\n                  </many-to-many>\n\n            </set>\n\n            <set name=\"exForEtablissements\" table=\"RF_JOUR_ETABLISSEMENT_EX_F_784\">\n\n                  <key>\n\n                        <column name=\"JOUR_DATE_CALENDRIER\"/>\n\n                  </key>\n\n                  <many-to-many unique=\"true\" class=\"fr.stime.model.Etablissement\">\n\n                        <column name=\"ETABLISSEMENT_CODE\" sql-type=\"VARCHAR(3)\" />\n\n                  </many-to-many>\n\n            </set>\n\nSeul le 1er et 3ème  <set> sont incorrects : \n\ncreate table RF_PERIODESCOLAIRE_JOUR_JOUR (JOUR_DATE_CALENDRIER TIMESTAMP not null, PERIODESCOLAIRE integer not null, primary key (PERIODESCOLAIRE, JOUR_DATE_CALENDRIER));\n\ncreate table RF_COEFFICIENTSCORRECTEURS_FE1 (COEFFICIENTSCORRECTEURS integer not null, JOUR_DATE_CALENDRIER DATE not null, primary key (JOUR_DATE_CALENDRIER, COEFFICIENTSCORRECTEURS));\n\ncreate table RF_JOUR_ETABLISSEMENT_EX_F_784 (JOUR_DATE_CALENDRIER TIMESTAMP not null, ETABLISSEMENT_CODE VARCHAR(3) not null, primary key (JOUR_DATE_CALENDRIER, ETABLISSEMENT_CODE));\n\nalors que JOUR_DATE_CALENDRIER devrait être de type DATE;\n',NULL,'3','1','6','2009-03-23 16:23:31','2010-02-04 10:18:24',NULL,'0',NULL,NULL,NULL,'19001',NULL,NULL,NULL,'2009-09-09 11:00:23','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('11439','MDA-5','10074','egrosse','fdaugan','2','Création du stéréotype \"Label\"','Le stéréotype \"Label\" n existe pas et ne peut donc pas être rajouté à une \"Page\"\n  -> obligation pour le moment d utiliser le stéréotype \"Input\" en mode read only.',NULL,'4','1','6','2009-03-24 10:52:59','2009-09-09 10:58:47',NULL,'0',NULL,NULL,NULL,'20295',NULL,NULL,NULL,'2009-09-09 10:58:47','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('11472','MDA-6','10074','xsintive','fdaugan','1','Libellé Plugin RSM','Dans RSM, lorsqu on applique un stéréotype \"sqlData\" à un attribut, dans le menu \"advanced\" on renseigne les propriétés sous le libellé \"Business\" => non cohérent',NULL,'4','1','6','2009-03-27 10:44:12','2010-02-04 10:22:57',NULL,'0',NULL,NULL,NULL,'19003',NULL,NULL,NULL,'2009-07-17 16:53:50','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('11476','MDA-7','10074','xsintive','fdaugan','1','Génération hbm.xml','Complément du précédent (on peut modifier les précédentes demandes ?)\n\nLe cas se produit également pour la table de jointure : \ncreate table RF_ETABLISSEMENT_ENTREPOT__2CB (ENTREPOT_CODE varchar2(255 char) not null, ETABLISSEMENT_CODE VARCHAR(3) not null, primary key (ETABLISSEMENT_CODE, ENTREPOT_CODE));\n\noù le ENTREPOT_CODE devrait être un varchar(3) au lieu d être un varchar2(255)\n\n\nAinsi que pour le discriminant (stratégie d héritage) : \n\ncreate table PR_ASEUIL (ID integer not null, DISCR varchar2(255 char) not null, SOUSACTIVITE_CODE VARCHAR(13), ENTREPOT_CODE VARCHAR(3), ETABLISSEMENT_CODE VARCHAR(3), primary key (ID));\n',NULL,'3','1','6','2009-03-27 15:30:10','2010-02-04 10:18:24',NULL,'0',NULL,NULL,NULL,'19005',NULL,NULL,NULL,'2009-07-17 16:54:48','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('11535','MDA-8','10074','challer','fdaugan','2','Création d un wizard VO/DO to CRUD','Dans le cadre du projet phoenix, il est nécessaire de créer un wizard permettant à partir d un VO ou d un DO de créer l ensemble des éléments UML impliqués dans un CRUD (action, page, macroactivity, callAction, callPage, service, diagramme de séquences).',NULL,'3','13','6','2009-04-01 14:20:29','2009-09-03 11:50:32',NULL,'0',NULL,NULL,NULL,'20296',NULL,NULL,NULL,'2009-09-03 11:50:30','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('11538','MDA-11','10074','challer','fdaugan','2','Validateur de modèle','Il faudrait intégrer dans RSM un validateur de modèle, sur un élément uml, et sur l ensemble du projet. Les informations (warning et errors) seraient affichées au travers de la vue \"Problems\".\n\nCe validateur serait accessible via le menu contextuel MDA',NULL,'3','1','6','2009-04-01 14:39:59','2009-10-23 15:41:07',NULL,'0',NULL,NULL,NULL,'20297',NULL,NULL,NULL,'2009-10-23 15:41:03','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('11542','MDA-14','10074','challer','fdaugan','2','Création d un wizard d ajout d un lien vers une maquette','Il serait intéressant d avoir un wizard permettant d ajouter sur un élément \"page\" un lien vers une maquette. Plutôt que de devoir créer un \"url\" à la main, le wizard prendrait en charge cette tâche tout en stéréotypant l\"url\" par \"maq\" ou \"screen\"....',NULL,'4','12','6','2009-04-01 15:08:35','2010-03-31 13:57:59',NULL,'0',NULL,NULL,NULL,'20255',NULL,NULL,NULL,'2010-03-08 12:44:28','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('13394','MDA-43','10074','fdaugan','fdaugan','1','Liens meta-derive meta PIM & non meta PIM','Les liens meta-derive associés à un meta PIM et un non meta PIM sont biens ignorés mais devraient être indiqués comme une erreur de méta modélisations puisqu ils n ont aucun sens.',NULL,'5','1','6','2009-09-03 09:41:04','2010-02-04 10:18:10',NULL,'0',NULL,NULL,NULL,'18960',NULL,NULL,NULL,'2009-10-25 23:19:12','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('13396','MDA-45','10074','fdaugan','fdaugan','2','Visibilité de opérations à vérifier','Les opérations devraient toutes être publics.',NULL,'4','13','6','2009-09-03 09:50:05','2009-10-25 15:48:27',NULL,'0',NULL,NULL,NULL,'20301',NULL,NULL,NULL,'2009-10-23 15:34:45','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('13397','MDA-46','10074','fdaugan','fdaugan','2','Ajouter une contrainte de visibilité','Le stéréotype internal permet de marquer un composant PIM ne pouvant être appelé que par un composant de même type.\nUn composant PIM sans ce stéréotype ne peux être appelé par un composant PIM de même type avec le stéréotype <<internal>>\n\nExemple :\nOK {<<bd>> <<internal>> Class1} --> {<<bd>> <<internal>> Class2}\nOK {<<bd>> Class1} --> {<<bd>> <<internal>> Class2}\nOK {<<bd>> Class1} --> {<<bo>> Class2}\nOK {<<bd>> <<internal>> Class1} --> {<<bo>>  Class2} si OK {<<bd>> Class1} --> {<<bo>> Class2}\n\nKO {<<bd>> <<internal>> Class1} --> {<<bd>> Class2}\nKO {<<bd>> Class1} --> {<<bo>> <<internal>> Class2}\n\n',NULL,'3','1','6','2009-09-03 09:57:23','2010-02-04 10:22:57',NULL,'0',NULL,NULL,NULL,'20300',NULL,NULL,NULL,'2009-10-25 15:50:31','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('13400','MDA-48','10074','fdaugan','fdaugan','2','Detecter les duplications d operations','Lors de l analyse du modèle les opérations dupliquées devraient être détectées en tant que WARNING dans un même classifier.',NULL,'5','1','6','2009-09-03 10:27:14','2009-10-25 11:21:10',NULL,'0',NULL,NULL,NULL,'20302',NULL,NULL,NULL,'2009-09-03 11:11:39','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('13402','MDA-49','10074','fdaugan','fdaugan','2','Replacer <<transition>> par des stéréotypes plus spécifiques','Replacer les stéréotype <<transition>> des control flow par des stéréotype liés aux événements plus spécifiques :\nchange\nkeyEvent\nmouseEvent\nvalidate\n\nA chaque évènement une ou plusieurs données spécifiques à cet événement, et un composant de type property.',NULL,'3','1','6','2009-09-03 11:09:05','2009-09-09 11:00:01',NULL,'0',NULL,NULL,NULL,'20299',NULL,NULL,NULL,'2009-09-03 11:12:12','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('13420','MDA-50','10074','fdaugan','fdaugan','2','Détecter la présence de méthodes dans les actions','Détecter la présence de méthodes dans les actions par un WARNING.\nEffectivement des opérations dans ce type d élément n a pas de sens dons la modélisation MDA CSN pour le moment.',NULL,'4','1','6','2009-09-03 17:59:28','2009-10-23 15:32:56',NULL,'0',NULL,NULL,NULL,'20303',NULL,NULL,NULL,'2009-10-23 15:32:22','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('13570','MDA-51','10074','fdaugan','fdaugan','2','Ajouter le stéréotype \"radioGroup\"','Ajouter un stéréotype pour représenter un ensemble de boutons radio. \nLe stéréotype doit permettre la sélection du bouton radio à sélectionner par défaut. Cette dernière propriété est optionnelle mais si renseignée, doit se référer à un des boutons radio qu il contiendra.',NULL,'3','1','6','2009-09-14 19:35:56','2009-09-15 12:08:47',NULL,'0',NULL,NULL,NULL,'20305',NULL,NULL,NULL,'2009-09-15 12:08:41','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('13571','MDA-52','10074','fdaugan','fdaugan','1','Création dynamique des éléments dérivés','Lors de la création d élément tels que les \"UseCase\", les éléments dérivés n étaient pas créés (la \"macroativity\" pour notre exemple)',NULL,'3','1','6','2009-09-14 20:11:04','2009-09-15 19:21:10',NULL,'0',NULL,NULL,NULL,'19011',NULL,NULL,NULL,'2009-09-15 19:09:16','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('13577','MDA-53','10074','fdaugan','fdaugan','2','Procédure de migration de profile suite à une mise à jour','La mise à jour de plugin peut embarquer une mise à jour des profiles existants et donc demander une migration des modèles ouverts dans le workspace qui utilisent ces profiles.\nLa documentation sera mise à jour pour indiquer la procédure à suivre, notamment lorsqu il y a plusieurs concepteurs travaillant en parallèle.',NULL,'3','1','6','2009-09-15 09:47:44','2009-09-15 19:09:34',NULL,'0',NULL,NULL,NULL,'20306',NULL,NULL,NULL,'2009-09-15 19:09:34','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('13673','MDA-55','10074','fdaugan','fdaugan','2','Permettre la génération de documentation avec un menu contextuel','La génération documentaire existe par le biais de gestion de stéréotypes de documentation, mais devrait être remplacée par un menu contextuel au niveau des modèles PIM.',NULL,'3','1','6','2009-09-21 00:12:35','2009-10-25 23:18:44',NULL,'0',NULL,NULL,NULL,'20304',NULL,NULL,NULL,'2009-10-25 23:18:37','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('13692','MDA-56','10074','fdaugan','fdaugan','2','Spécification de l unité de champ','Permettre la spécification de l unité à affiché à droite d un champ de saisie ou d étiquette. Si l unité renseignée est vide (par défaut) aucune unité n est affichée.',NULL,'4','1','6','2009-09-22 09:30:44','2009-10-25 16:08:09',NULL,'0',NULL,NULL,NULL,'20307',NULL,NULL,NULL,'2009-10-25 16:08:04','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('13837','MDA-57','10074','ydubrasquet','fdaugan','1','Génération CRUD les VO sont vides','Le tout fonctionne bien sous condition d avoir la version 1.0.3 de phoenix.\nUne livraison globale 1.3.1 de MDA Core et phoenix 1.0.3 est prévue le 26/oct./09',NULL,'3','1','6','2009-10-01 16:34:02','2009-10-25 15:52:11',NULL,'0',NULL,NULL,NULL,'18995',NULL,NULL,NULL,'2009-10-01 16:35:43','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('13935','MDA-58','10074','fdaugan','fdaugan','2','Vérification des règles de conception à travers un menu','Pour valider les modèles de conception, un outil \"checkstyle\" accessible par un menu contextuel depuis un modèle permet de valider le contenu ainsi que les modèles dépendants.\nL ensemble des erreurs catégorisées sont reportées dans la vues \"problems\" d Eclipse.',NULL,'3','1','6','2009-10-09 09:46:03','2009-10-25 15:53:05',NULL,'0',NULL,NULL,NULL,'20308',NULL,NULL,NULL,'2009-10-09 09:48:02','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('13936','MDA-59','10074','fdaugan','fdaugan','2','Inclusion des éléments hors-périmètres dans la vérification des règles de conception','Certains éléments du modèle (PIM) peuvent avoir été définis somme exclus de ces contrôles soit parce qu ils sont hors périmètres (importé, dérivés,...) soit parce qu ils sont les moins critiques du système . L option \"checkstyle full\" permet d aller outres cette exclusion.',NULL,'3','1','6','2009-10-09 09:49:10','2009-10-23 15:34:26',NULL,'0',NULL,NULL,NULL,'20309',NULL,NULL,NULL,'2009-10-23 15:34:22','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('13937','MDA-60','10074','fdaugan','fdaugan','2','Complétion automatique des types des éléments typés','La modélisation peut être incomplète en ce qui concerne le type des éléments typés : propriété ou paramètre.\nL outil de vérification \"checkstyle\" met déjà en évidence ces problèmes bloquant pour certaines génération (documentation ou code), mais la tâche de mise à niveau peut s avérer conséquente.\nLa fonctionnalité \"Auto type completion\" permet de compléter automatiquement les types de ces élément en se basant sur le noms des éléments associé (\"code porte\" --> Integer, \"date de fin de congé\"-> Date,...) avec pour type par défaut \"String\".\nCette fonctionnalité est à utiliser avec parsimonie et ne doit pas se substituer à un réel travail de conception.',NULL,'3','1','6','2009-10-09 09:55:28','2009-10-25 15:53:55',NULL,'0',NULL,NULL,NULL,'20310',NULL,NULL,NULL,'2009-10-25 15:53:48','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('13939','MDA-61','10074','fdaugan','fdaugan','2','Génération documentaire Flex','Les modèles de type \"application\" peuvent être exportés au format Flex et déployé sur un serveur HTTP.\nLes fichiers générés ainsi que leur emplacement sont indiqués dans la console MDA en fin de génération.',NULL,'3','1','6','2009-10-09 09:57:52','2009-11-06 13:01:45',NULL,'0',NULL,NULL,NULL,'20311',NULL,NULL,NULL,'2009-11-06 13:01:34','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('13940','MDA-62','10074','fdaugan','fdaugan','2','Génération documentaire ExtJS','Les modèles de type \"application\" peuvent être exportés au format ExtJS (html riche) et déployé sur un serveur HTTP.\nLes fichiers générés ainsi que leur emplacement sont indiqués dans la console MDA en fin de génération.\n\nAttention, sous Internet Explorer, le rendu peut être lent.',NULL,'3','1','6','2009-10-09 09:58:25','2010-10-21 21:45:15',NULL,'0',NULL,NULL,NULL,'20259',NULL,NULL,NULL,'2009-10-09 10:02:14','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('13942','MDA-63','10074','fdaugan','fdaugan','2','Génération documentaire Html','Les modèles de type \"application\" peuvent être exportés au format Html et déployé sur un serveur HTTP.\nLes fichiers générés ainsi que leur emplacement sont indiqués dans la console MDA en fin de génération.',NULL,'3','1','6','2009-10-09 09:58:45','2009-11-06 15:15:15',NULL,'0',NULL,NULL,NULL,'20312',NULL,NULL,NULL,'2009-10-09 10:02:22','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('13943','MDA-64','10074','fdaugan','fdaugan','2','Génération documentaire Excel','Les modèles de type \"application\" peuvent être exportés au format Excel et prend en compte pour le moment les entités \"do\" afin d analyser (via des macro par exemple) les différentes cardinalités / entités de la base de données.',NULL,'3','1','6','2009-10-09 10:01:06','2009-11-06 14:41:48',NULL,'0',NULL,NULL,NULL,'20313',NULL,NULL,NULL,'2009-11-06 14:41:45','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('13983','MDA-65','10074','ydubrasquet','fdaugan','2','Quel Data type utiliser pour les heures minutes?','Pour les valeurs décimales, il faut utiliser le type \"UnlimitedNatural\" . Quel type utiliser pour les heures minutes?',NULL,'3','2','6','2009-10-12 12:27:34','2009-10-25 13:36:01',NULL,'0',NULL,NULL,NULL,'20315',NULL,NULL,NULL,'2009-10-25 13:35:54','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('13989','MDA-66','10074','ydubrasquet','fdaugan','1','Pas de génération de la documentation pour le projet Phoenix à partir de RSM','Le projet Phoenix prévoit que l étude soit directement enregistrée dans RSM. Il reste toutefois le problème de la génération de la documentation.\nSans avoir une documentation personnalisée pourrions nous avoir dans un premier temps une documentation \"standard\" ou du moins déjà existante comme nous en avions convenu en juin dernier.',NULL,'3','1','6','2009-10-12 15:06:41','2009-11-24 13:02:40',NULL,'0',NULL,NULL,NULL,'18975',NULL,NULL,NULL,'2009-11-12 12:43:49','1');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('13990','MDA-67','10074','ydubrasquet','fdaugan','1','travail collaboratif pble CRUD','Du fait du travail collaboratif des projets distincts sont mis en place pour les BD, les BO, les DAO,les usecases. La gestion des CRUD à partir d un \"DO\" telle que prévue doit être revue car elle génère automatiquement un BD, un BO, un usecase dans des modèles fixes propres au projet.\nIl faudrait pouvoir paramétrer les modèles de destination pour le BD, le BO et le usecase.\nSi techniquement il est impossible en génération de CRUD de générer le BD,BO et usecase dans des projets différents , il faut convenir d un environnement de travail pour les CRUD , une fois la génération réalisée il faudra réaliser des \"move\" des objets dans les projets concernés.',NULL,'3','1','6','2009-10-12 16:23:05','2010-05-12 00:41:02',NULL,'0',NULL,NULL,NULL,'18967',NULL,NULL,NULL,'2009-11-23 20:09:47','1');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('13992','MDA-68','10074','ydubrasquet','fdaugan','1','supprimer le package Actors du modèle Business BD','Peut-on supprimer le package Actors du modèle Business BD du projet phoenix-uml-commun. Les diagrammes de séquence des CRUD n utiliseront plus l acteur user, le package Actors est donc inutile. \nA supprimer dès que le plugging MDA57 pourra être implémenté.',NULL,'3','1','6','2009-10-12 16:30:23','2009-11-06 13:05:10',NULL,'0',NULL,NULL,NULL,'18976',NULL,NULL,NULL,'2009-11-06 11:05:45','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14043','MDA-69','10074','esimonneau','alocquet','2','IHM : Mapping explicite entre attribut de vo et composant graphique','Où et comment exprimer le mapping entre les attributs du vo récupéré du BD et les composants graphiques associés ?',NULL,'3','1','6','2009-10-15 13:53:27','2009-12-21 20:53:00',NULL,'0',NULL,NULL,NULL,'20287',NULL,NULL,NULL,'2009-12-21 20:53:00','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14044','MDA-70','10074','esimonneau','fdaugan','2','METIER : Mapping explicite attribut de vo et info récupéré des moteurs (DAO)','Comment indiquer explicitement le mapping entre les informations récupérées du moteur et les attributs correspondant du vo en cours de constitution. La règle implicite \"les attributs sont alimentés dans l ordre des colonnes reçues\" n est pas assez structurante. De plus, en cas d insertion d un attribut ou d une information, des risques de décalages existent.',NULL,'3','1','6','2009-10-15 13:58:01','2009-12-09 20:01:41',NULL,'0',NULL,NULL,NULL,'20316',NULL,NULL,NULL,'2009-12-09 20:01:41','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14045','MDA-71','10074','esimonneau','alocquet','2','Disposer d un stéréotype « lostFocus »','Détecter la perte du focus sur un composant graphique pour déclencher une transition.',NULL,'3','13','6','2009-10-15 13:59:11','2009-12-03 21:56:55',NULL,'0',NULL,NULL,NULL,'20317',NULL,NULL,NULL,'2009-11-27 12:55:55','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14046','MDA-72','10074','esimonneau','fdaugan','2','IHM : Disposer de stéréotype « actionIhm » et « callActionIhm » pour modéliser les actions IHM et leur utilisation dans les diagrammes','Pour modéliser les actions IHM qui ne sont pas des opération de flux (\"action\", \"callAction\"). Ces actions sont nombreuses dans une application RIA.',NULL,'3','2','6','2009-10-15 14:01:15','2009-11-06 14:26:18',NULL,'0',NULL,NULL,NULL,'20318',NULL,NULL,NULL,'2009-11-06 14:26:14','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14047','MDA-73','10074','esimonneau','fdaugan','2','IHM : Faut-il / Comment modéliser la constitution du vo écran suite à l appel des différents BD pour acquérir toutes les données utiles au chargement ?','On considère qu une action IHM appelle le(s) BD(s) nécessaires à la recherche des données avant d appeler la page.\nSi plusieurs BD sont appelés, plusieurs vo sont retournés. Comment sont-ils matérialisés. Faut-il les décrire ou bien leur assemblage est implicite ?\n',NULL,'3','1','6','2009-10-15 14:03:24','2009-11-06 14:25:56',NULL,'0',NULL,NULL,NULL,'20319',NULL,NULL,NULL,'2009-11-06 14:25:56','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14048','MDA-74','10074','esimonneau','alocquet','2','IHM : Affiner les stéréotypes modélisant une grille','Voir document transmis par Rémi F. à F.Daugan et C.Haller.\nL idée est d ajouter diverses propriétés caractérisant la grille (sens de tri, nom des colonnes, ...).\nAinsi que des stéréotypes comme \"ligne\" avec des propriétés (ligne de modification, d ajout, mais aussi de détail, de regroupement ...)\n',NULL,'3','13','6','2009-10-15 14:06:17','2009-12-03 21:57:03',NULL,'0',NULL,NULL,NULL,'20320',NULL,NULL,NULL,'2009-12-03 17:32:20','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14049','MDA-75','10074','esimonneau','alocquet','2','IHM : Comment modéliser une popup avec ou sans influence sur la page ou le fragment qui l appelé','Dans une RIA, il y a des boîtes de dialogues (modales ou non) de sélection, de recherche, etc. avec influence ou non sur la page ou le frament appelant.',NULL,'3','13','6','2009-10-15 14:08:21','2009-12-16 19:49:09',NULL,'0',NULL,NULL,NULL,'20284',NULL,NULL,NULL,'2009-12-16 12:12:12','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14050','MDA-76','10074','esimonneau','alocquet','2','IHM : Comment modéliser un composant réutilisable comme le sélecteur de période, de population ? ','Dans ChronoGestor, beaucoup d écrans nécessite la sélection d un individu ou d une population et d une date ou d une période.\nNous avons besoin de définir une seule fois ces \"composants\" et les réutiliser dans les différents usecase des écrans les utilisant.\n\nComment modéliser de tels composants ?\n\nComment les utiliser dans les usecases appelants ? L idéal serait de pouvoir :\n- \"tirer\" le composant sur le diagramme d activité d une page / d un fragment,\n- \"tirer\" les actions du usecase à mettre en oeuvre sur ce même diagramme,\n- \"tirer\" des transitions du composant vers les actions du usecase en précisant sur la transition la nature de l événement émis par le composant qui doit déclencher l action ((sur changement de date, sur changement d employé). Cela implique de pouvoir définir sur le composant les événements pouvant être déclenchés.\n\n',NULL,'3','13','6','2009-10-15 14:13:02','2009-12-09 10:25:03',NULL,'0',NULL,NULL,NULL,'20321',NULL,NULL,NULL,'2009-11-27 12:07:39','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14052','MDA-77','10074','esimonneau','alocquet','2','IHM : Outil consolidant plusieurs diagramme(s) d activité(s) en un seul afin d avoir une vue globale.','Attention : demande différente de celle évoquée oralement.\r\n\r\nLe besoin consiste à pouvoir consulter une consolidation de diagrammes d activités afin d avoir une vue d ensemble.\r\nNous sommes parti du principe que pour un écran riche, on a :\r\n- le \"macro-actvity\" diagramme,\r\n- un diagramme par page du usecase,\r\n- un diagramme par fragment de page,\r\nPouvoir obtenir en consultation, une consolidation pour une page ou le usecase. Ce diagramme sera d autant plus lisible que les éléments appartenant à un même \"sous\" diagramme sont représentés de la même couleur ou dans une même partition (ou autre idée à trouver).\r\nUn clic droit sur la page ou le usecase pourrait nous proposer cette option.',NULL,'4','11','6','2009-10-15 14:19:11','2011-09-30 12:29:40',NULL,'0',NULL,NULL,NULL,'20260',NULL,NULL,NULL,'2011-09-30 12:28:42','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14054','MDA-78','10074','esimonneau','fdaugan','2','[IHM] Lorsqu on tire un élément dans un diagramme d activité, si l élement ne se situe pas au même niveau, le matérialiser (couleur ?).','Nous partons du principe que tous les éléments utilisés dans un diagramme se trouvent au même niveau d arborescence que le diagramme lui-même dans la vue \"Project explorer\".\n\nPar conséquent, si on réutilise une action existante sur une autre diagramme, la matérialiser différemment (couleur ?) afin de voir qu elle n appartient pas au diagramme en cours.',NULL,'4','1','6','2009-10-15 14:24:07','2010-10-21 21:48:14',NULL,'0',NULL,NULL,NULL,'20261',NULL,NULL,NULL,'2010-04-27 18:45:35','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14056','MDA-79','10074','esimonneau','alocquet','2','Règles supplémentaires pour le checkstyle','Le checkstyle doit vérifier que :\n- pour les éléments de saisie que les propriétés nécessaires sont valorisées (type, cardinalité, maxlength, etc.) sont renseignés, ainsi que les propriétés de composant graphique (maxlength, etc.)\n- que tous les éléments utilisés dans un diagramme se trouvent au même niveau d arborescence que le diagramme lui-même dans la vue \"Project explorer\" => warning',NULL,'3','1','6','2009-10-15 14:27:52','2009-11-10 11:03:25',NULL,'0',NULL,NULL,NULL,'20323',NULL,NULL,NULL,'2009-11-10 11:03:17','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14058','MDA-80','10074','esimonneau','alocquet','2','IHM : Contrainte en entrée d une page (parameter sur activity). Incohérence ?','Nous avons convenu que pour modéliser le fait qu une page nécessite en entrée certaines informations, il fallait ajouter un élément parameter sur la page.\n\nDans le diagramme d activité, nous aurons souvent une action IHM pour obtenir les données de la page avec une transition sur la page elle-même (callPage). C est cette action IHM qui a besoin des paramètres d entrée pour aller chercher les données et le fait que le paramètre soit associé à la page est troublant. Le définir en amont de l action IHM semblerait plus logique, non ?\n',NULL,'3','1','6','2009-10-15 14:33:46','2009-11-24 17:48:42',NULL,'0',NULL,NULL,NULL,'20322',NULL,NULL,NULL,'2009-11-24 17:48:36','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14059','MDA-81','10074','esimonneau','alocquet','2','IHM : Comment modéliser plusieurs transitions dont l ordre n a fonctionnellement pas d importance (faux parallélisme)','Typiquement, une page est composée de fragments indiépendant. Dans son diag. d activité, du point initial partent autant de transition vers les fragments. Il n ya pas d ordre précis à l enchaînement de ces transistions d un point de vue conception. Donc le concepteur ne doit pas être obligé de séquencer la cascade (c est un problème de développement et la solution doit être imaginée à ce niveau).',NULL,'3','13','6','2009-10-15 14:36:35','2009-12-22 23:55:13',NULL,'0',NULL,NULL,NULL,'20288',NULL,NULL,NULL,'2009-12-08 10:55:02','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14060','MDA-82','10074','esimonneau','fdaugan','2','IHM : Comment modéliser un groupe d onglets dont chaque contenu est décrit par un fragment ?','RSM ne permet pas, dans la vue project explorer, de déplacer les fragments dans un onglet ...',NULL,'3','3','6','2009-10-15 14:37:51','2010-09-16 16:20:19',NULL,'0',NULL,NULL,NULL,'20324',NULL,NULL,NULL,'2009-10-15 14:57:49','1');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14061','MDA-83','10074','esimonneau','alocquet','2','IHM : Comment modéliser un menu contextuel et les actions qu il doit déclencher ?',NULL,NULL,'3','13','6','2009-10-15 14:38:51','2009-12-22 18:03:26',NULL,'0',NULL,NULL,NULL,'20289',NULL,NULL,NULL,'2009-12-15 12:01:08','1');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14062','MDA-84','10074','esimonneau','alocquet','2','IHM : Les méthodes de page voient-elles le contexte ou faut-il leur passer des paramètres ?','La question se pose entre autre dans les méthodes de rafraîchissement d une page ou d un fragment.',NULL,'3','1','6','2009-10-15 14:54:44','2010-02-19 17:41:05',NULL,'0',NULL,NULL,NULL,'20262',NULL,NULL,NULL,'2010-01-30 17:24:54','0');
