insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14065','MDA-86','10074','esimonneau','fdaugan','2','[t2m] Pouvoir importer depuis fichier excel les éléments d un usecase ','Une page pouvant contenir de nombreux composants graphiques, imbriqués les uns dans les autres, les manipulations nécessaires dans RSM sont parfois fastidieuses et répétitives.\r\nPour gagner en productivité, le concepteur pourrait définir ces infos dans une feuille excel (format à définir) qui soit importable dans RSM avec création automatique de tous les éléments UML, diagrammes d activités, stéréotypage, etc. Si les éléments existent déjà, leurs caractéristiques sont mises à jour.',NULL,'3','3','6','2009-10-15 15:04:51','2011-09-22 09:23:52',NULL,'0','57600','57600',NULL,'20263',NULL,NULL,NULL,'2011-04-07 22:12:00','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14066','MDA-87','10074','esimonneau','fdaugan','2','IHM : Pouvoir générer pour une page / un fragment le code HTML correspondant aux éléments modélisés','Etudier un outil permettant d obtenir le code HTML à partir des éléments d IHM modélisés dans RSM (pour une page ou un fragement.\nAvantages :\n- la mise en page peut être travaillée en conception sans avoir à refaire tous les éléments => productivité.\n- génération du \"code\" de la page pour le développement ???\n\nAvec un tel outil, il faudrait alors pouvoir indiquer sur les éléments UML composants graphique la classe CSS associée ...',NULL,'3','11','6','2009-10-15 15:08:21','2011-07-05 01:03:46',NULL,'0',NULL,NULL,NULL,'20264',NULL,NULL,NULL,'2011-02-25 20:44:28','0');
