insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14158','MDA-92','10074','fdaugan','fdaugan','2','Saisie de l unité dans tous les champs de saisie.','Prévoir dans la conception des composants de saisie et d affichage textuel linéaire, une propriétée optionnelle \"unity\" qui représente l unité, ou plus généralement, la zone de texte habituellement affichée sur la droite du champ.\nLes composants impactés : input, select et label',NULL,'3','1','6','2009-10-21 14:39:58','2009-10-23 15:43:50',NULL,'0',NULL,NULL,NULL,'20327',NULL,NULL,NULL,'2009-10-23 15:43:47','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14159','MDA-93','10074','fdaugan','fdaugan','2','Ajouter la propriété \"pattern\" et \"maxLength\" pour les select','Ajouter la propriété \"pattern\" et \"maxLength\" pour les select.\nCette propriété est déjà disponible pour le composant \"input\"',NULL,'3','1','6','2009-10-21 14:43:58','2009-10-23 15:43:34',NULL,'0',NULL,NULL,NULL,'20328',NULL,NULL,NULL,'2009-10-23 15:43:33','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14162','MDA-94','10074','fdaugan','fdaugan','2','Spécification de la non possibilité d effectuer des actions de masses pour \"grid\"','Le composant \"grid\" représente naturellement une grille de données dans laquelle des actions de masse peuvent être appliquées. Ce fonctionnement n est cependant possible que si l IHM permet la sélection d une ou plusieurs lignes par l intermédiaire de case à cocher.\nAfin de masquer ces cases à cocher et donc de supprimer la possibilité d effectuer des actions de masse, la propriété booléenne \"hasMassAction\" est ajoutée, et est à <true> par défaut.',NULL,'3','1','6','2009-10-21 14:54:55','2009-10-23 15:43:16',NULL,'0',NULL,NULL,NULL,'20329',NULL,NULL,NULL,'2009-10-23 15:43:06','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14164','MDA-95','10074','fdaugan','fdaugan','2','Ajouter un stéréotype pour les vues','Une vue de base de données est un \"do\" dont les attributs surcharges d autres attributs d autres \"do\" ou \"view\".\nUn nouveau stéréotype doit être ajouté et permettre son identification visuelle.',NULL,'3','1','6','2009-10-21 15:17:55','2009-10-25 23:13:18',NULL,'0',NULL,NULL,NULL,'20330',NULL,NULL,NULL,'2009-10-23 15:44:44','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14167','MDA-96','10074','fdaugan','fdaugan','2','Permettre de lier des pages à un ensemble autre que des use cases','Permettre de lier des pages à un ensemble autre que des use cases.\nEn effet certaines pages peuvent être liée par un contexte plus étendu que les use cases. Ce peut être le cas de wizards multi-usecase permettant de stoker en sessions des données qui ne seront persistées qe dans une action finale.',NULL,'3','1','6','2009-10-21 17:21:06','2009-10-25 23:18:00',NULL,'0',NULL,NULL,NULL,'20331',NULL,NULL,NULL,'2009-10-25 23:18:00','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14233','MDA-99','10074','fdaugan','fdaugan','2','Outils de remplacement automatique de type natif','Dues aux limitations de UML, une bibliothèques de types natifs (java) a été mis à disposition.\nAfin d éviter l utilisation de types natifs au lieu des types primitifs UML disponibles, et en attendant la mise à disposition de nouveaux types primitif, un outil permettant de remplacer l utilisation de types natifs par les équivalents primitifs UML. ',NULL,'4','1','6','2009-10-24 21:07:25','2009-10-26 19:18:30',NULL,'0',NULL,NULL,NULL,'20332',NULL,NULL,NULL,'2009-10-26 19:18:25','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14234','MDA-100','10074','fdaugan','fdaugan','2','Afficher le context complet des erreurs d analyse','Lors des analyse \"checkStyle\" liées à plusieurs éléments UML, afficher l ensemble des éléments UML en plus de l élément principalement concerné.',NULL,'3','1','6','2009-10-25 11:34:14','2009-10-26 19:16:47',NULL,'0',NULL,NULL,NULL,'20333',NULL,NULL,NULL,'2009-10-26 19:16:43','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14237','MDA-101','10074','fdaugan','fdaugan','2','Détéction des conflits de paramètres : type et multiplicité','Détection du défaut de conception suivant :\nOperation O1 (Type1[0,1] nomParametre)\nOperation O2 (Type2[0,1] nomParametre)\nOperation O3 (Type2[*] nomParametre)\nOperation O4 ()\n\nSi O1 appelle O2 alors {\n erreur car nomParametre a 2 types différents\n}\n\nSi O1 appelle O3 alors {\n erreur car nomParametre a 2 types identiques mais de cardinalité différente\n}\n\nSi O4 appelle O1,O2 alors {\n erreur car nomParametre a 2 types différents\n}',NULL,'3','1','6','2009-10-25 13:03:45','2009-10-26 19:16:15',NULL,'0',NULL,NULL,NULL,'20334',NULL,NULL,NULL,'2009-10-26 19:16:11','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14238','MDA-102','10074','fdaugan','fdaugan','2','Vérifier qu un seul type de retour est spécifié dans une opération',NULL,NULL,'3','1','6','2009-10-25 18:33:53','2009-11-06 13:14:02',NULL,'0',NULL,NULL,NULL,'20335',NULL,NULL,NULL,'2009-11-06 13:13:59','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14259','MDA-103','10074','ydubrasquet','alocquet','2','Où renseigner les paramètres d entrée de la méthode appelée dans le diagramme de séquence? Peut-on les proposer automatiquement?','Pour chacune des méthodes appelées dans le diagramme de séquence, il faut définir les paramètres d entrée de ces méthodes.\n\nIl n existe pas d endroit spécifique dans RSM pour spécifier les paramètres.\nLe CSN nous a demandé de les saisir dans documentation. Il existe 4 éléments associés à la méthode appelée : \n•	la flèche d appel de la méthode, \n•	le nom associé à la méthode appelée dans le diagramme de séquence,\n•	la flèche de retour de la méthode, \n•	le nom associé au retour de la méthode dans le diagramme de séquence.\nNous avons choisi de saisir la documentation sur le nom associé dans le diagramme à la méthode appelée\n\nMerci au CSN de valider que les paramètres d entrée de la méthode appelée dans le diagramme de séquence soient renseignés dans la documentation du nom associé à la méthode appelée.\nEst-il possible de proposer dans cette documentation les attributs de la méthode appelée pour les renseigner.\n',NULL,'3','13','6','2009-10-26 16:05:33','2009-12-16 19:49:00',NULL,'0',NULL,NULL,NULL,'20291',NULL,NULL,NULL,'2009-12-11 15:40:51','1');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14260','MDA-104','10074','ydubrasquet','alocquet','2','Comment indiquer explicitement le mapping entre les attributs en entrée de méthode et les clauses de requêtes.','Il n y a pas de mapping explicite des attributs d entrée de la méthode.\nDans cet exemple nous avons fait attention d ordonner les éléments de la clause where dans l ordre des paramètres d entrée de la méthode.\nComment indiquer explicitement le mapping entre les attributs en entrée de méthode et les clauses de requêtes.\n\n',NULL,'3','13','6','2009-10-26 16:09:47','2009-12-16 19:49:58',NULL,'0',NULL,NULL,NULL,'20292',NULL,NULL,NULL,'2009-12-15 12:06:30','1');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14262','MDA-105','10074','ydubrasquet','fdaugan','6','Comment utiliser les attributs d entrée de type VO dans les clauses des requetes?','Comment remplacer les attributs des dates d entrée par le VO liste des dates (de la méthode appelante)  dans la clause where de la  requete correspondant à la méthode appelée.',NULL,'3','3','6','2009-10-26 16:23:57','2011-02-07 09:58:54',NULL,'0',NULL,NULL,NULL,'20285',NULL,NULL,NULL,'2010-10-23 14:54:14','1');
