insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14354','MDA-108','10074','fdaugan','fdaugan','1','[checkstyle] les Macroactivity ne devraient pas avoir de la documentation','Les activités <<macroActivity>> ne devraient pas avoir de documentation, car seule celle du use-case fait foi.\nLa présence de documentation dans cet élément sera qualifié en \"info\".',NULL,'5','1','6','2009-10-30 09:15:47','2009-11-06 13:04:30',NULL,'0',NULL,NULL,NULL,'19196',NULL,NULL,NULL,'2009-11-06 11:07:15','0');
