insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14663','MDA-141','10074','fdaugan','fdaugan','2','[checkstyle] Détecter les opérations incohérentes dans les diagrammes de séquence','Sous certaines conditions, il est possible d obtenir un diagramme de séquence dans lequel une opération non proxy (résolue) attachée à un message, pointe vers une ligne de vie dont le type ne correspond pas à l interface/classe de cette opération.\n',NULL,'3','1','6','2009-11-23 19:38:48','2009-11-24 10:40:03',NULL,'0',NULL,NULL,NULL,'20349',NULL,NULL,NULL,'2009-11-24 10:40:03','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14664','MDA-142','10074','fdaugan','fdaugan','2','[checkstyle] Détecter l absence de diagramme de séquence pour les opérations non <<DAO>>','Les opérations appartenant à des entités non finales (<<bd>>, <<bo>>, <<action>>, <<page>>) devraient âtres associées à des diagrammes de séquence --> info',NULL,'3','1','6','2009-11-23 20:22:00','2009-11-23 23:57:27',NULL,'0',NULL,NULL,NULL,'20350',NULL,NULL,NULL,'2009-11-23 23:57:21','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14665','MDA-143','10074','fdaugan','fdaugan','2','Outil de réassociation des diagrammes de séquence','Il se peut que certains diagrammes de séquence ne soient associé à une opération que par leur nom.\nC est pour cela que la spécification des interaction (portant le diagramme de séquence) doit être liée à l opération qu elle décrit.\n\nIl arrive que lors de la conception, ce lien soit oublié. Malgré la présence de contrôle de modèle (checkstyle) la ta^che peut s avérer grande si le modèle à évolué sans ce contrôle jusqu à présent.\nCe nouvel outil va pouvoir ré-associer, lorsque c est déterministe, l interaction à la bonne opération en se basant sur le nom de l opération et de l interaction.',NULL,'3','1','6','2009-11-23 20:42:59','2009-11-23 23:56:26',NULL,'0',NULL,NULL,NULL,'20314',NULL,NULL,NULL,'2009-11-23 23:56:21','0');
