insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14670','MDA-145','10074','fdaugan','alocquet','2','[checkstyle] Détecter le cas où plusieurs interractions sont associées à la même opération',NULL,NULL,'3','1','6','2009-11-24 10:34:10','2009-12-23 09:50:50',NULL,'0',NULL,NULL,NULL,'20270',NULL,NULL,NULL,'2009-12-23 09:50:50','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14671','MDA-146','10074','fdaugan','fdaugan','2','[checkstyle] Détecter les noms des diagrammes de séquence désynchronisé du nom de l opération','Dans le cas où une interaction (séquence) est associée à une opération via sa spécification UML, si  les noms ne sont pas semblables -> erreur',NULL,'3','1','6','2009-11-24 10:44:15','2009-11-24 10:44:53',NULL,'0',NULL,NULL,NULL,'20352',NULL,NULL,NULL,'2009-11-24 10:44:23','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14672','MDA-147','10074','fdaugan','fdaugan','2','Intégrer dans l outil de réparation des diagrammes de séquence la correction des noms de fonction','Lorsque l interaction associée à une opération a été trouvée, et que le nom est similaire mais différent, nommer cette interaction exactement de même nom.\nExemple :\nopération = \"Rechercher les Personnes\"\ninteraction= \"rechercher des   personnes\"\n\nLes noms sont semblables mais différents, l outil actualisera le nom de l interaction.\n\nPour le cas suivant, checkstyle reporte déjà une erreur (MDA-146)\nopération = Rechercher les Personnes\ninteraction= rechercher une personne\n',NULL,'3','1','6','2009-11-24 10:44:46','2009-11-24 10:45:04',NULL,'0',NULL,NULL,NULL,'20353',NULL,NULL,NULL,'2009-11-24 10:45:01','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14673','MDA-148','10074','calvarezdelamarina','alocquet','2','Modélisation de plusieurs properités de nom identique','Il y a parfois plusieurs champs d une même page dont les libellés doivent être identiques. Comment intégrer ce besoin en conception ?',NULL,'4','1','6','2009-11-24 11:13:29','2009-12-23 09:52:22',NULL,'0',NULL,NULL,NULL,'20271',NULL,NULL,NULL,'2009-12-23 09:52:22','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14675','MDA-149','10074','tribeaucoup','alocquet','2','Export d un fichier DOT pour le projet ESPACE','J aurai besoin d un fichier texte contenant l ensemble des dépendances de développement de ce qui est conçu.\n\nLe formalisme est (sans les crochets):\ndigraph G {\n[élément A] -> [élément B] (élément A dépends de élément B)\n}\n\nLes dépendances demandées sont :\n- chaque Use case dépends de quelle page et quels controllers\n- chaque Controleur dépends de quelles méthodes de quel BD\n- chaque méthode de chaque BD dépends de quelles méthodes de quels BO\n- chaque méthode de chaque BO dépends de quelles méthodes de quels BO et DAO\n\nLe mieux serait également de disposer des regroupements sous la forme\nsubgraph \"[nom du subgraphe]\" { element1; element2; element3; }\n\nLes subgraphes intéressants seraient :\n- Les BD (contiennent les méthodes du BD)\n- Les BO (contiennent les méthodes du BO)\n- Les DAO (contiennent les méthodes du DAO)\n\n',NULL,'4','13','6','2009-11-24 11:49:45','2009-12-03 21:57:57',NULL,'0',NULL,NULL,NULL,'20354',NULL,NULL,NULL,'2009-11-30 15:36:49','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14676','MDA-150','10074','fdaugan','alocquet','2','[checkstyle] N autoriser les stéréotype <<xxxevent>> que pour les transitions venant d une page','Les stéréotype de déclenchement par événement ne sont utiliser que sur des transitions issues d une page, sinon --> erreur',NULL,'3','13','6','2009-11-24 13:01:32','2009-12-03 21:58:23',NULL,'0',NULL,NULL,NULL,'20355',NULL,NULL,NULL,'2009-11-27 12:55:46','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14682','MDA-151','10074','fdaugan','alocquet','1','[checkstyle] La détection des opérations ordonnées n indique pas le nom de l opération','La détection des opérations ordonnées n indique pas le nom de l opération mais seulement le nom de la classe/interface la contenant.',NULL,'3','1','6','2009-11-24 15:27:17','2009-11-27 11:20:47',NULL,'0',NULL,NULL,NULL,'19538',NULL,NULL,NULL,'2009-11-25 14:36:07','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14688','MDA-152','10074','esimonneau','alocquet','1','Checkstyle : Messages \"ACTION must be called from somewhere\" et \"OPERATION should be called from somewhere\"','Ces messages apparaissent pour des actions / operation appelées ailleurs que sur le \"Macro Activity, derived\" diagram.\n\nContexte Phoenix :\n- les actions sont réparties au niveau \"page\" et \"pageFragment\",\n- les actions sont appelées dans des diagrammes d activité situés au même niveau \"page\" et \"pageFragment\",\n- une action se contente exclusivement d appeler une méthode de \"page\" ou \"pageFragement\"\n- c est la méthode de \"page\" ou \"pageFragement\" qui effectue le traitement (décrit dans un diagramme de séquence)',NULL,'3','13','6','2009-11-24 16:12:25','2010-02-04 10:22:57',NULL,'0',NULL,NULL,NULL,'19544',NULL,NULL,NULL,'2009-11-30 17:48:17','1');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14703','MDA-153','10074','fdaugan','alocquet','2','Pouvoir définir la propriété de libellé et la propriété de clé à utiliser pour un \"select\"','Pour les composant \"select\" et \"list\", lorsqu une type non primitif est associé, (ie. un <<vo>>), il faut pouvoir associer la propriété du <<vo>> à utiliser en tant que libellé, et la propriété à utiliser en tant que  clé.\nDeux nouvelles propriétés sont apportées au stéréotype <<select>>\n - \"label\" : correspond à la propriétés utilisée pour afficher le libellé\n - \"key\" : correspond à la propriétés utilisée pour afficher le libellé\n\nLes contrôles inhérents :\n- si le type du <<select>>/<list>> n est pas un type primitif, alors la propriété \"label\" doit être renseignée\n- si le type du <<select>>/<list>> n est pas un type primitif, alors la propriété \"key\" doit être renseignée\n- si la propriété \"label\" est renseignée, le composant <<select>> doit être typé\n- si la propriété \"key\" est renseignée, le composant <<select>> doit être typé\n- si la propriété \"label\" est renseignée, elle doit être définie dans le type du composant <<select>>/<<list>>\n- si la propriété \"key\" est renseignée, elle doit être définie dans le type du composant <<select>>/<list>>\n\nMettre à jour la documentation.',NULL,'3','13','6','2009-11-24 17:04:22','2009-12-03 22:04:09',NULL,'0',NULL,NULL,NULL,'20356',NULL,NULL,NULL,'2009-12-01 11:22:33','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14704','MDA-154','10074','ydubrasquet','fdaugan','1','Word persistance incomplet , dao worker','Les DAO Worker dont le stéréotype est \"daoInternal\" ne sont  pas pris en compte dans la documentation .\nSolution de contournement changer le stéréotype des DAO Worker pour y mettre le meme stéréotype \"dao\" que les DAO Manager. ajouter le mot \"Worker  dans le champ keyword pour les différencier',NULL,'3','1','6','2009-11-24 17:27:17','2009-12-03 21:58:33',NULL,'0',NULL,NULL,NULL,'19560',NULL,NULL,NULL,'2009-12-01 20:09:31','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14705','MDA-155','10074','ydubrasquet','fdaugan','1','Word persistance manque diagramme de séquence','Les DAO Manager sont des ordonnancements de DAO Worker , cet ordonnancement et sa documentation sont décrits dans les diagrammes de séquence qui n apparaissent pas dans la documentation.',NULL,'3','1','6','2009-11-24 17:30:59','2009-12-04 01:20:50',NULL,'0',NULL,NULL,NULL,'19561',NULL,NULL,NULL,'2009-12-03 20:05:40','0');
