insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14783','MDA-168','10074','fdaugan','fdaugan','1','[phoenix] L utilisation des <<PageFragment>> empêche la génération documentaire.','L utilisation du stéréotype <<pageFragment>> dans les modèles UML empêche la génération documentaire pour le projet Phoenix.\nCette erreur est due à l absence de définition de l utilisation des <<pageFragment>> dans le meta-modèle du projet.',NULL,'3','1','6','2009-11-26 19:21:18','2009-12-08 19:12:51',NULL,'0',NULL,NULL,NULL,'19639',NULL,NULL,NULL,'2009-11-26 19:21:39','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14806','MDA-169','10074','fdaugan','fdaugan','2','[checkstyle] Vérifier que pour n transitions depuis un élement d activité, n-1 sont contraints','Dans un diagramme d activité, vérifier que pour n transitions provenant d un même nœud, n-1 sont contraints, c est à dire possèdent une contrainte.\n\nPour calculer l ensemble des transitions sortant d un nœud, les éléments de même type (<<page>>, <<action>>,...) et de même nom présent dans le même diagramme sont également considérés pour compter le nombre de transitions sortantes.\n',NULL,'3','1','6','2009-11-27 16:21:03','2009-11-27 17:39:42',NULL,'0',NULL,NULL,NULL,'20361',NULL,NULL,NULL,'2009-11-27 17:12:26','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('14807','MDA-170','10074','fdaugan','fdaugan','2','[checkstyle] Considérer les multiples utilisations de <<callxxx>> sur le même élément','Dans un diagramme d activité, vérifier que qu un nœud qui n est pas initial, soit lié à au moins un autre élément en entrée.\n\nPour calculer l ensemble des transitions entrant d un nœud, les éléments de même type (<<page>>, <<action>>,...) et de même nom présent dans le même diagramme sont également considérés.',NULL,'3','1','6','2009-11-27 16:55:36','2009-11-27 17:39:55',NULL,'0',NULL,NULL,NULL,'20362',NULL,NULL,NULL,'2009-11-27 17:39:52','0');
