insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('15122','MDA-211','10074','calvarezdelamarina','fdaugan','2','[checkstyle] est-il possible d avoir une erreur checkstyle à partir de 3 boucles imbriquées ?','Faire une analyse allant plus loin que la simple interaction en analysant également les interactions induites par l appel des méthodes.\n\nAnalyse les \"loop\" dont la profondeur totale :\n>2 = warning\n>3 = error\n\nMettre à jour la documentation dans les conseils de modélisation des diagrammes de séquence.',NULL,'3','1','6','2009-12-11 11:00:24','2010-02-19 17:41:11',NULL,'0',NULL,NULL,NULL,'20283',NULL,NULL,NULL,'2010-01-31 17:17:43','0');
