insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('15171','MDA-214','10074','rfumery','fdaugan','1','Certains caractères disparaissent lorsque l on retire le focus de la documentation d un attribut de do.','Lorsque je consulte la documentation de certains attributs de do, si je clique dans cette documentation, puis sur un autre élément, RSM m indique qu un changement a été effectué.\nIl apparaît que cela est du à la présence du caractère &#xD; qui est supprimé lorsque cette manoeuvre est effectuée.',NULL,'3','1','6','2009-12-14 15:21:58','2010-03-31 13:58:43',NULL,'0',NULL,NULL,NULL,'20033',NULL,NULL,NULL,'2010-03-01 10:39:18','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('15215','MDA-215','10074','fdaugan','fdaugan','2','[word] Ajouter les opérations d activité','Dans la documentation Word, inclure un bloc correspondant aux opérations définies dans une <<page>> ou une <<pageFragment>>',NULL,'3','1','6','2009-12-15 10:46:28','2010-01-08 14:18:09',NULL,'0',NULL,NULL,NULL,'20378',NULL,NULL,NULL,'2009-12-21 20:52:06','1');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('15273','MDA-216','10074','tribeaucoup','fdaugan','2','Ajout du graphe de dépendance dans les DCT par UseCase','Dans le DCT par UseCase, dans le chapitre \"Couche Presentation > UseCase > Action\", après la description de l action et du diagramme de séquence, il serait pratique d avoir le diagramme de dépendance de l action.\n\nLe diagramme de dépendance contiendrait :\n- Le controller (au format  \"<<action>> [Nom de l action]\" : exemple \"<<action>> Enregistrer les données de l essai\")\n- Les BD (au format \"[NomInterfaceBD].[NomMethodeBD]\" : exemple \"ICommunBD.recupererFluxCompteRenduPourEssaiGlobal\")\n- Les BO (au format \"[NomInterfaceBO].[NomMethodfeBO]\" : exemple \"ICampagneBO.recupererPuissanceThermique\")\n- Les DAO (au format \"[NomDAO].[NomMethodeDAO]\" : exemple \"CALCalibrage.creerCalibrage\")\n\nLes regroupements à effectuer :\n- Les BD sont regroupés par [NomInterfaceBD]\n- Les BO sont regroupés par [NomInterfaceBO]\n- Les DAO sont regroupés par [NomDAO]\n\nSi possible :\n- L ensemble des [NomInterfaceBD] sont regroupés dans le groupe \"BD\"\n- L ensemble des [NomInterfaceBO] sont regroupés dans le groupe \"BO\"\n- L ensemble des [NomInterfaceDAO]sont regroupés dans le groupe \"DAO]\n(Si complexe à mettre en oeuvre ou visuellement pas pratique, le système de couleur actuel est très bien)\n\n',NULL,'4','1','6','2009-12-16 09:54:44','2010-03-31 13:57:59',NULL,'0',NULL,NULL,NULL,'20411',NULL,NULL,NULL,'2010-03-08 09:53:13','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('15274','MDA-217','10074','tribeaucoup','fdaugan','1','DCT par UseCase : Génération des apostrophes','Les apostrophes sont mal générées dans le doc. Exemple :\n\"La conception respecte les règles définies par l approche MDA de GFI.\"\n',NULL,'4','1','6','2009-12-16 10:00:47','2009-12-23 10:42:53',NULL,'0',NULL,NULL,NULL,'20412',NULL,NULL,NULL,'2009-12-23 10:42:53','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('15369','MDA-218','10074','rfumery','alocquet','6','Comment savoir sur quel diagramme se trouve un appel de méthode ?','Lorsque l on fait modeling references>workspace sur une méthode, on sait dans quel package elle est utilisée mais sans plus de précision.\nPar exemple, on va avoir uniquement cette info : <SendOperationEvent> Business - BD - CANA::CANA::SendOperationEvent9',NULL,'3','13','6','2009-12-18 14:33:23','2009-12-22 11:06:07',NULL,'0',NULL,NULL,NULL,'20508',NULL,NULL,NULL,'2009-12-22 11:06:07','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('15371','MDA-219','10074','rfumery','alocquet','2','Savoir lorsqu un redifined properties est supprimé suite à une modification du modèle.','Lorsque l on modifie le modèle en supprimant un attribut par exemple. Si un élément a ses propriétés redéfinies par cet attribut alors le redifined propertie est supprimé sans que l utilisateur soit en mesure d être informé.',NULL,'3','13','6','2009-12-18 14:37:10','2009-12-22 12:16:06',NULL,'0',NULL,NULL,NULL,'20510',NULL,NULL,NULL,'2009-12-22 10:32:36','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('15379','MDA-220','10074','fdaugan','alocquet','2','[checkstyle] Détecter les qualifiers de propriétés hors Activity','Il arrive que suite à une mauvaise manipulation, qu une propriété se retrouve sous la forme de qualifier d une propriété de classe --> erreur',NULL,'4','13','6','2009-12-19 15:52:57','2010-02-10 14:16:05',NULL,'0',NULL,NULL,NULL,'20518',NULL,NULL,NULL,'2009-12-28 17:01:30','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('15380','MDA-221','10074','fdaugan','alocquet','2','[checkstyle] Détecter les nom de message en désaccord avec le nom de l opération appelée associée','Lorsqu un message est créé dans un diagramme de séquence, son nom prend celui de l opération à laquelle il est associé\nSi au cours de la modélisation, le nom de l opération change, le nom du message reste inchangé.\n\nAfin d éviter de future ambiguïté, reporter en \"info\" cette incohérence mineure.',NULL,'5','13','6','2009-12-19 16:33:45','2010-02-10 14:15:47',NULL,'0',NULL,NULL,NULL,'20519',NULL,NULL,NULL,'2009-12-22 17:49:53','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('15381','MDA-222','10074','fdaugan','fdaugan','2','[cleanup] Intégrer la synchronisation des noms des messages','La demande MDA-221 détecte les désynchronisation de nom de message.\nÉtant donné que cette tâche peut être automatisée, inclure cette correction dans le \"cleanup\"',NULL,'4','1','6','2009-12-19 16:37:06','2010-05-04 23:59:10',NULL,'0',NULL,NULL,NULL,'20520',NULL,NULL,NULL,'2010-04-07 13:48:39','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('15382','MDA-223','10074','fdaugan','fdaugan','2','[cleanup] Nettoyer les événements d interaction innutilisés','Intégrer dans le \"cleanup\" le nettoyage (suppression) des événements send/receive qui ne sont plus rattaché à un diagramme de séquence.',NULL,'4','1','6','2009-12-19 16:39:49','2010-02-10 14:17:42',NULL,'0',NULL,NULL,NULL,'20521',NULL,NULL,NULL,'2010-01-30 20:27:49','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('15383','MDA-224','10074','fdaugan','fdaugan','2','[checkstyle] Détecter les événements d interaction inutilisés','Détecter les événements d interaction inutilisés, c est à dire ceux qui ne sont pas rattaché à une opération ou attaché à une opération proxy.',NULL,'3','1','6','2009-12-19 16:44:56','2010-05-04 23:59:10',NULL,'0',NULL,NULL,NULL,'20522',NULL,NULL,NULL,'2010-03-29 09:42:52','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('15384','MDA-225','10074','fdaugan','alocquet','2','[checkstyle] ne pas renseigner \"Specification\" pour les <<action>> ou leur interaction','\"Specification\" n a de sens que pour les interaction (conteneur de diagramme de séquence) des opérations.\nSi \"Specification\" renseigné pour une <<action>> -> warning\nSi \"Specification\" renseigné pour une interaction d <<action>> -> warning\n\nMettre à jour la documentation',NULL,'4','13','6','2009-12-19 16:55:14','2010-02-10 14:15:38',NULL,'0',NULL,NULL,NULL,'20523',NULL,NULL,NULL,'2009-12-24 15:57:00','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('15385','MDA-226','10074','fdaugan','fdaugan','2','Intégrer la suppressiondes \"Specification\" invalides dans le \"cleanup\"','Dans le \"cleanup\" intégrer la suppression de \"Specification\" pour les <<action>> et leur interaction.',NULL,'5','1','6','2009-12-19 17:09:59','2009-12-23 09:53:14',NULL,'0',NULL,NULL,NULL,'20524',NULL,NULL,NULL,'2009-12-23 09:53:14','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('15391','MDA-227','10074','esimonneau','alocquet','1','[CheckStyle] Erreur  A macro activity must have at least an entry point  inadaptée','Le modèle \"UC - Sélecteur population (réutilisable)\" contient un composant réutilisable défini dans un pageFragment.\nAucun diagramme \"macroActivity\" n a donc été créé. Pourtant, il a fallu en créer un pour lever d autres erreurs checkstyle et du coup on obtient l erreur  A macro activity must have at least an entry point  qui n a pa lieu d être.',NULL,'3','13','6','2009-12-21 10:45:18','2010-02-10 14:15:35',NULL,'0',NULL,NULL,NULL,'20530',NULL,NULL,NULL,'2009-12-24 11:02:25','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('15392','MDA-228','10074','esimonneau','fdaugan','1','[CheckStyle] Erreur  Activity must not own class or interface  inadaptée','Dans \"NEW - UC - Work- TP - Gérer un Compte (écran CG)\", l erreur semble provenir des fragments contenant des actions (héritant de classe ou interface). Pour autant, ces actions sont nécessaires à cet endroit.',NULL,'3','1','6','2009-12-21 10:48:20','2009-12-22 10:05:48',NULL,'0',NULL,NULL,NULL,'20531',NULL,NULL,NULL,'2009-12-22 10:05:48','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('15393','MDA-229','10074','esimonneau','fdaugan','1','[CheckStyle] Erreur  Called action is not visible from this page fragment  sans raison ?','Dans \"NEW - UC - Work- TP - Gérer un Compte (écran CG)\", fragment \"Barre de navigation\", \"callAction\" Obtenir données journalières d un compte employé.',NULL,'3','1','6','2009-12-21 10:51:15','2010-02-10 14:15:32',NULL,'0',NULL,NULL,NULL,'20532',NULL,NULL,NULL,'2010-01-08 16:17:30','1');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('15395','MDA-230','10074','esimonneau','alocquet','1','[CheckStyle] Erreur  custom event must have a defined component  à tort','Dans \"NEW - UC - Work- TP - Gérer un Compte (écran CG)\", fragment \"Barre de navigation\", message sur le dernier \"customEvent\" alors qu un composant lui est rattaché.',NULL,'3','1','6','2009-12-21 10:53:17','2010-02-10 14:15:29',NULL,'0',NULL,NULL,NULL,'20534',NULL,NULL,NULL,'2009-12-22 15:45:02','0');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('15396','MDA-231','10074','esimonneau','alocquet','2','[CheckStyle] Erreur  custom component is not visible from this page  à tort','Dans \"NEW - UC - Work- TP - Gérer un Compte (écran CG)\", fragment \"Barre de navigation\", message sur le composant réutilisable \"Sélecteur de population\"',NULL,'3','13','6','2009-12-21 10:55:21','2010-02-10 14:15:25',NULL,'0',NULL,NULL,NULL,'20626',NULL,NULL,NULL,'2009-12-24 10:53:02','1');
insert into jiraissue (ID, pkey, PROJECT, REPORTER, ASSIGNEE, issuetype, SUMMARY, DESCRIPTION, ENVIRONMENT, PRIORITY, RESOLUTION, issuestatus, CREATED, UPDATED, DUEDATE, VOTES, TIMEORIGINALESTIMATE, TIMEESTIMATE, TIMESPENT, WORKFLOW_ID, SECURITY, FIXFOR, COMPONENT, RESOLUTIONDATE, WATCHES) values('15406','MDA-232','10074','esimonneau','fdaugan','2','Intégrer les <<pageFragment>> dans la documentation Word en respectant la hiérarchie dans la page','Indenter les titres des chapitres en fonction de la hiérarchie des composants dans la page.',NULL,'2','1','6','2009-12-21 11:45:23','2010-03-22 16:22:10',NULL,'0',NULL,NULL,NULL,'21170',NULL,NULL,NULL,'2010-02-02 09:25:37','1');
