insert into changeitem (ID, groupid, FIELDTYPE, FIELD, OLDVALUE, OLDSTRING, NEWVALUE, NEWSTRING) values('25006','21231','jira','description',NULL,'En fait la version actuelle est la 3.1.13\n\n\nDans Jour.hbm\n\n<set name=\"periodeScolaire\" table=\"RF_PERIODESCOLAIRE_JOUR_JOUR\">\n\n                  <key>\n\n                        <column name=\"JOUR_DATE_CALENDRIER\"/>\n\n                  </key>\n\n                  <many-to-many class=\"fr.stime.model.PeriodeScolaire\">\n\n                        <column name=\"PERIODESCOLAIRE\" sql-type=\"integer\" />\n\n                  </many-to-many>\n\n            </set>\n\n            <set name=\"coefficientsCorrecteurs\" table=\"RF_COEFFICIENTSCORRECTEURS_FE1\">\n\n                  <key>\n\n                        <column name=\"JOUR_DATE_CALENDRIER\"/>\n\n                  </key>\n\n                  <many-to-many class=\"fr.stime.model.CoefficientCorrecteur\">\n\n                        <column name=\"COEFFICIENTSCORRECTEURS\" sql-type=\"integer\" />\n\n                  </many-to-many>\n\n            </set>\n\n            <set name=\"exForEtablissements\" table=\"RF_JOUR_ETABLISSEMENT_EX_F_784\">\n\n                  <key>\n\n                        <column name=\"JOUR_DATE_CALENDRIER\"/>\n\n                  </key>\n\n                  <many-to-many unique=\"true\" class=\"fr.stime.model.Etablissement\">\n\n                        <column name=\"ETABLISSEMENT_CODE\" sql-type=\"VARCHAR(3)\" />\n\n                  </many-to-many>\n\n            </set>\n\nSeul le 1er et 3ème  <set> sont incorrects : \n\ncreate table RF_PERIODESCOLAIRE_JOUR_JOUR (JOUR_DATE_CALENDRIER TIMESTAMP not null, PERIODESCOLAIRE integer not null, primary key (PERIODESCOLAIRE, JOUR_DATE_CALENDRIER));\n\ncreate table RF_COEFFICIENTSCORRECTEURS_FE1 (COEFFICIENTSCORRECTEURS integer not null, JOUR_DATE_CALENDRIER DATE not null, primary key (JOUR_DATE_CALENDRIER, COEFFICIENTSCORRECTEURS));\n\ncreate table RF_JOUR_ETABLISSEMENT_EX_F_784 (JOUR_DATE_CALENDRIER TIMESTAMP not null, ETABLISSEMENT_CODE VARCHAR(3) not null, primary key (JOUR_DATE_CALENDRIER, ETABLISSEMENT_CODE));\n\nalors que JOUR_DATE_CALENDRIER devrait être de type DATE;\n',NULL,'En fait la version actuelle est la 3.1.13\n\nDans Jour.hbm\n\n<set name=\"periodeScolaire\" table=\"RF_PERIODESCOLAIRE_JOUR_JOUR\">\n\n                  <key>\n\n                        <column name=\"JOUR_DATE_CALENDRIER\"/>\n\n                  </key>\n\n                  <many-to-many class=\"fr.stime.model.PeriodeScolaire\">\n\n                        <column name=\"PERIODESCOLAIRE\" sql-type=\"integer\" />\n\n                  </many-to-many>\n\n            </set>\n\n            <set name=\"coefficientsCorrecteurs\" table=\"RF_COEFFICIENTSCORRECTEURS_FE1\">\n\n                  <key>\n\n                        <column name=\"JOUR_DATE_CALENDRIER\"/>\n\n                  </key>\n\n                  <many-to-many class=\"fr.stime.model.CoefficientCorrecteur\">\n\n                        <column name=\"COEFFICIENTSCORRECTEURS\" sql-type=\"integer\" />\n\n                  </many-to-many>\n\n            </set>\n\n            <set name=\"exForEtablissements\" table=\"RF_JOUR_ETABLISSEMENT_EX_F_784\">\n\n                  <key>\n\n                        <column name=\"JOUR_DATE_CALENDRIER\"/>\n\n                  </key>\n\n                  <many-to-many unique=\"true\" class=\"fr.stime.model.Etablissement\">\n\n                        <column name=\"ETABLISSEMENT_CODE\" sql-type=\"VARCHAR(3)\" />\n\n                  </many-to-many>\n\n            </set>\n\nSeul le 1er et 3ème  <set> sont incorrects : \n\ncreate table RF_PERIODESCOLAIRE_JOUR_JOUR (JOUR_DATE_CALENDRIER TIMESTAMP not null, PERIODESCOLAIRE integer not null, primary key (PERIODESCOLAIRE, JOUR_DATE_CALENDRIER));\n\ncreate table RF_COEFFICIENTSCORRECTEURS_FE1 (COEFFICIENTSCORRECTEURS integer not null, JOUR_DATE_CALENDRIER DATE not null, primary key (JOUR_DATE_CALENDRIER, COEFFICIENTSCORRECTEURS));\n\ncreate table RF_JOUR_ETABLISSEMENT_EX_F_784 (JOUR_DATE_CALENDRIER TIMESTAMP not null, ETABLISSEMENT_CODE VARCHAR(3) not null, primary key (JOUR_DATE_CALENDRIER, ETABLISSEMENT_CODE));\n\nalors que JOUR_DATE_CALENDRIER devrait être de type DATE;\n');
