insert into changeitem (ID, groupid, FIELDTYPE, FIELD, OLDVALUE, OLDSTRING, NEWVALUE, NEWSTRING) values('39469','30194','jira','description',NULL,'Lors de la transformation du modèle en document Word, serait-il possible de  : \n\nCréer une section Vues dans le document Word.\n\nCette section regroupera tous les objets possédant, entre autres, le stéréotype \"view\" défini dans le PIM. Ces objets ne devront plus être présent dans la section regroupant les \"do\" (alors qu ils peuvent en posséder le stéréotype).\nCes objets \"view\" auront des liens d utilisations (\"use\") vers d autres objets du modèle (éventuellement stéréotypés \"view\") afin de préciser sur quels objets repose leur construction.\n\nL ajout de stéréotype \"view\" ne changera en rien la génération Java du modèle.\n\n',NULL,'Lors de la transformation du modèle en document Word, serait-il possible de  : \n\nCréer une section Vues dans le document Word.\n\nCette section regroupera tous les objets possédant, entre autres, le stéréotype \"view\" défini dans le PIM. Ces objets ne devront plus être présent dans la section regroupant les \"do\" (alors qu ils peuvent en posséder le stéréotype).\nCes objets \"view\" auront des liens d utilisations (\"use\") vers d autres objets du modèle (éventuellement stéréotypés \"view\") afin de préciser sur quels objets repose leur construction. \nIl se peut que les objets référencés n aient pas de stéréotypes.\n\nL ajout de stéréotype \"view\" ne changera en rien la génération Java du modèle.\n\n');
