insert into changeitem (ID, groupid, FIELDTYPE, FIELD, OLDVALUE, OLDSTRING, NEWVALUE, NEWSTRING) values('40688','30810','jira','description',NULL,'En fait la version actuelle est la 3.1.13 \n\nComplément du précédent (on peut modifier les précédentes demandes ?)\n\nLe cas se produit également pour la table de jointure : \ncreate table RF_ETABLISSEMENT_ENTREPOT__2CB (ENTREPOT_CODE varchar2(255 char) not null, ETABLISSEMENT_CODE VARCHAR(3) not null, primary key (ETABLISSEMENT_CODE, ENTREPOT_CODE));\n\noù le ENTREPOT_CODE devrait être un varchar(3) au lieu d être un varchar2(255)\n\n\nAinsi que pour le discriminant (stratégie d héritage) : \n\ncreate table PR_ASEUIL (ID integer not null, DISCR varchar2(255 char) not null, SOUSACTIVITE_CODE VARCHAR(13), ENTREPOT_CODE VARCHAR(3), ETABLISSEMENT_CODE VARCHAR(3), primary key (ID));\n',NULL,'Complément du précédent (on peut modifier les précédentes demandes ?)\n\nLe cas se produit également pour la table de jointure : \ncreate table RF_ETABLISSEMENT_ENTREPOT__2CB (ENTREPOT_CODE varchar2(255 char) not null, ETABLISSEMENT_CODE VARCHAR(3) not null, primary key (ETABLISSEMENT_CODE, ENTREPOT_CODE));\n\noù le ENTREPOT_CODE devrait être un varchar(3) au lieu d être un varchar2(255)\n\n\nAinsi que pour le discriminant (stratégie d héritage) : \n\ncreate table PR_ASEUIL (ID integer not null, DISCR varchar2(255 char) not null, SOUSACTIVITE_CODE VARCHAR(13), ENTREPOT_CODE VARCHAR(3), ETABLISSEMENT_CODE VARCHAR(3), primary key (ID));\n');
