insert into changeitem (ID, groupid, FIELDTYPE, FIELD, OLDVALUE, OLDSTRING, NEWVALUE, NEWSTRING) values('58243','39692','jira','description',NULL,'Pour valider les modèles de conception, un outil \"checkstyle\" accessible par un menu contextuel depuis un modèle permet de valider le contenu ainsi que les modèles dépendants.\nCertains éléments du modèle (PIM) peuvent avoir été définis somme exclus de ces contrôles soit parce qu ils sont hors périmètres (importé, dérivés,...) soit parce qu ils sont les moins critiques du système . L option \"checkstyle full\" permet d aller outres cette exclusion.',NULL,'Pour valider les modèles de conception, un outil \"checkstyle\" accessible par un menu contextuel depuis un modèle permet de valider le contenu ainsi que les modèles dépendants.\nL ensemble des erreurs catégorisées sont reportées dans la vues \"problems\" d Eclipse.');
