insert into changeitem (ID, groupid, FIELDTYPE, FIELD, OLDVALUE, OLDSTRING, NEWVALUE, NEWSTRING) values('58257','39700','jira','description',NULL,'Les modèles de type \"application\" peuvent être exportés au format flex et déployé sur un serveur HTTP.\nLes fichiers générés aisi que leur emplacement sont indiqués dans la console MDA en fin de génération.',NULL,'Les modèles de type \"application\" peuvent être exportés au format Flex et déployé sur un serveur HTTP.\nLes fichiers générés ainsi que leur emplacement sont indiqués dans la console MDA en fin de génération.');
