insert into changeitem (ID, groupid, FIELDTYPE, FIELD, OLDVALUE, OLDSTRING, NEWVALUE, NEWSTRING) values('59683','40406','jira','description',NULL,'Nous partons du principe que tous les éléments utilisés dans un diagramme se trouvent au même niveau d arborescence que le diagramme lui-même dans la vue \"Project explorer\".\n\nPar conséquent, si on réutilise une action existante sur une autre diagramme, la matérialiser différemment (couleur ?) afin de voir qu elle n appartient pas au diagramme en cours.\nPrévoir dans le checkstyle une information sur ce type d appel (pour vérifcation humaine derrière).\n',NULL,'Nous partons du principe que tous les éléments utilisés dans un diagramme se trouvent au même niveau d arborescence que le diagramme lui-même dans la vue \"Project explorer\".\n\nPar conséquent, si on réutilise une action existante sur une autre diagramme, la matérialiser différemment (couleur ?) afin de voir qu elle n appartient pas au diagramme en cours.');
