insert into changeitem (ID, groupid, FIELDTYPE, FIELD, OLDVALUE, OLDSTRING, NEWVALUE, NEWSTRING) values('69865','45564','jira','description',NULL,'Dans un diagramme de séquence d <<action>>, <<bd>>, <<bo>>,...., la première ligne de vie doit être :\n- Soit un acteur, mais doit alors directement appelé l opération associée à ce diagramme de séquence\n- Soit directement le conteneur : <<action>>, <<bd>>, <<bo>>,....\n\nLe non respect des contraintes sera reportée en tant qu erreur.',NULL,'Dans un diagramme de séquence d <<action>>, <<bd>>, <<bo>>,...., la première ligne de vie doit être :\n- Soit un acteur, mais doit alors directement appeler l opération associée à ce diagramme de séquence\n- Soit directement le conteneur : <<action>>, <<bd>>, <<bo>>,....\n\nLe non respect des contraintes sera reportée en tant qu erreur.');
