insert into changeitem (ID, groupid, FIELDTYPE, FIELD, OLDVALUE, OLDSTRING, NEWVALUE, NEWSTRING) values('69881','45574','jira','description',NULL,'Lors de l utilisation de la fonctionnalité de CRUD, les events issus de la génération des diagrammes de séquence sont placé dans le modèle le plus proche de l interaction.\nPour simplifier un éventuel déplacement futur des éléments générés, pouvoir embarquer dans le package, l ensemble des événements associés, et donc pour celà que ces events soient placés juste au niveau du package contenant l interaction.',NULL,'Lors de l utilisation de la fonctionnalité de CRUD, les events issus de la génération des diagrammes de séquence sont placé dans le modèle le plus proche de l interaction.\nPour simplifier un éventuel déplacement futur des éléments générés, pouvoir embarquer dans le package, l ensemble des événements associés, et donc pour cela que ces events soient placés juste au niveau du package contenant l interaction.');
