insert into changeitem (ID, groupid, FIELDTYPE, FIELD, OLDVALUE, OLDSTRING, NEWVALUE, NEWSTRING) values('72091','46723','jira','description',NULL,'Dans un diagramme d activité, vérifier que pour n transitions provenant d un même nœud, n-1 sont contraints, c est à dire possèdent une contrainte.\n\nPour calculer l ensemble des transitions sortant d un noeud, les éléments de même type (<<page>>, <<action>>,...) et de même nom présent dans le même diagramme sont également considérés pour compter le nombre de transitions sortantes.\n',NULL,'Dans un diagramme d activité, vérifier que pour n transitions provenant d un même nœud, n-1 sont contraints, c est à dire possèdent une contrainte.\n\nPour calculer l ensemble des transitions sortant d un nœud, les éléments de même type (<<page>>, <<action>>,...) et de même nom présent dans le même diagramme sont également considérés pour compter le nombre de transitions sortantes.\n');
